class Hello{
	def log;
	def context;
	def testRunner;

	def Hello(log,context,testRunner){
	this.log=log
	this.context=context
	this.testRunner=testRunner
	}
	def sayHello(){
		log.info("  Saying Hello...")
		}
		def total(){
			a=10
			b=8
			result=a+b
			log.info("Print Total in output..."+result)
			}
			}
	//to inzaintate this class we have to give this command at the end of the call
	context.setProperty("Hello",new Hello(log,context,testRunner))
	context.setProperty("Hello",new Hello(log,context,testRunner))

class Method{
	def log;
	def context;
	def testRunner;

	def Method(log,context,testRunner){
	this.log=log
	this.context=context
	this.testRunner=testRunner
	}

		def total(int a,int b){
			result=a+b
			log.info("Print Total in output..."+result)
			}
		}
	//to inzaintate this class we have to give this command at the end of the call
	context.setProperty("Method",new Method(log,context,testRunner))

